import React, { useState } from 'react';
import {
    Row,
    Col,
    Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';

import "./ItemComponent.css"


import 'bootstrap/dist/css/bootstrap.min.css';
export default function ItemComponent(){
    console.log(process.env.PUBLIC_URL);
    const listItemFashion = {
        bag: [
            {
                imgDisplay: process.env.PUBLIC_URL + "tui1.png",
                imgContinue: process.env.PUBLIC_URL + "tui1.1.png",
                name: "Túi Messenger Ipad Camo",
                price: "460.000₫",
                typeColor:[]    
            },
            {
                imgDisplay: process.env.PUBLIC_URL + "tui2.png",
                imgContinue: process.env.PUBLIC_URL + "tui2.1.png",
                name: "Túi Mini Camo",
                price: "290.000₫",
                typeColor:[]    
            } ,  
            {
                imgDisplay: process.env.PUBLIC_URL + "tui3.png",
                imgContinue: process.env.PUBLIC_URL + "tui3.1.png",
                name: "Túi Đeo Chéo Zumba Camo",
                price: "250.000₫",
                typeColor:[]    
            } ,  
            {
                imgDisplay: process.env.PUBLIC_URL + "tui4.png",
                imgContinue: process.env.PUBLIC_URL + "tui4.1.png",
                name: "Túi Grand Camo",
                price: "360.000₫",
                typeColor:[]    
            }  ,
            {
                imgDisplay: process.env.PUBLIC_URL + "tui5.png",
                imgContinue: process.env.PUBLIC_URL + "tui5.1.png",
                name: "Túi Crossbody Camo",
                price: "395.000₫",
                typeColor:[]    
            }  ,
            {
                imgDisplay: process.env.PUBLIC_URL + "tui6.png",
                imgContinue: process.env.PUBLIC_URL + "tui6.1.png",
                name: "Balo quai chéo Zumba",
                price: "380.000₫",
                typeColor:["black"]    
            }  ,
            {
                imgDisplay: process.env.PUBLIC_URL + "tui7.png",
                imgContinue: process.env.PUBLIC_URL + "tui7.1.png",
                name: "Túi Hộp Oxford",
                price: "320.000₫",
                typeColor:["black","gray"]    
            }  ,
            {
                imgDisplay: process.env.PUBLIC_URL + "tui8.png",
                imgContinue: process.env.PUBLIC_URL + "tui8.1.png",
                name: "Túi Đeo Chéo Lớn Zumba",
                price: "340.000₫",
                typeColor:["black"]    
            }  

        ]
    }

    const[Slide, setSlide] = useState({
        isSlide:false
    })

    var slideStyle = "btn btn-default ";

    slideStyle = Slide.isSlide ? (slideStyle + "slide-style") : (slideStyle + "see-all-style");


    return(
        <Row>
            <Col>
                <section className="section-spacing">
                    <div className="title-list-item">
                        <Row>
                            <Col xl="12">
                                <div className="small-title">Collection</div>
                            </Col>
                            <Col xl="12">
                                <div className="main-title">
                                        <button className="btn btn-default">Bags/Briefcases</button>
                                        <button className="btn btn-default"> Card Wallet</button>
                                </div>
                            </Col>
                        </Row>
                    </div>
                    <div className="wrapper-list-item">
                        <Row>
                            {
                                listItemFashion.bag.map(item => {
                                    return(
                                        <Col lg="3" sm="6" className="card-spacing">
                                            <Card className="card-style">
                                                <CardImg top width="100%" src={item.imgDisplay} alt="Card image cap" />
                                                <CardBody className="title-price-style"> 
                                                    <CardTitle tag="h6">{item.name}</CardTitle>

                                                    <CardSubtitle tag="h6" className="mb-2 text-muted">{item.price}</CardSubtitle>

                                                    <div className="btn-change-color"> 
                                                        <label></label>
                                                        <label className="gray-label"></label>
                                                    </div>
                                                </CardBody>
                                            </Card>
                                        </Col>
                                    );
                                })
                            }
                        </Row>
                    </div>
                    <div className="button-all">
                        <Row>
                            <input type="button" className={slideStyle} value="See All" onMouseOver={() => {setSlide({ isSlide: true})}} onMouseOut={() => {setSlide({ isSlide: false})}}/>
                        </Row>
                    </div>
                </section>
            </Col>
        </Row>
    );
}
